\\ makeup tips for my dry skin babes 🫶🏽

✨Skin prep is the most important step of doing makeup. You can use a hydrating serum or just go
straight to a rich creamy moisturizer that won’t make you look greasy but will smoothen out any rough, dry patches and make your skin look glowy af. 

@nacific_official Fresh Herb Origin Serum*
@nacific.in Fresh Herb Origin Cream*

✨Primer is optional (I forget on most days) but if you do use one make sure it’s hydrating & blurring at the same time. You can also just apply it on areas where you really need it. 
@elfcosmetics Poreless Putty Primer

✨For the base stick to lightweight concealers, foundations & tints. Key is to use something thats hydrating & makes the skin look luminous with minimal effort. Always remember with base makeup less is more!

@maybelline_ind Instant Age Rewind Concealer - 150 Neutral
@charlottetilbury Light Wonder Foundation
@narsissist Radiant Creamy Concealer - Ginger 

✨Cream / liquid blushes, bronzers & highlighters are your best friend. They look a lot more natural on the skin and are easier to blend without looking patchy on the skin. 

@nudestix Nudies All Over Face Color - Bondi Bae
@makeuprevolution Super Dewy Liquid Blush - You Had Me At First Blush
@glossier Haloscope - Quartz

✨You don’t need to set your whole face with powder. Instead just use a powder in areas where you really need it. Small controlled motions are they best. I usually apply a little under my eyes & on my t-zone. 

@charlottetilbury Airbrush Flawless Finish - Medium 2

✨Finish off the look with a hydrating setting spray. This will just ensure everything stays looked it and your skin looks fresh and dewy all night.

@rarebeauty Always An Optimist - 4-in-1 Mist

Hope you found these tips helpful! 

